void closeOk()
{
    if (prodMultiReportFinished.checkCloseDialog()
        && element.pdsCheckBaseValue())
    {
        if (this.pdsCheckBatchDates())
        {
            InventBatch::pdsUpdateNullBatchDateRAF(prodParmReportFinished.ProdId);
        }
        super();
    }
}

