void doReselect()
{
    ProdParmReportFinished  prodParmReportFinishedTmp;

    select prodParmReportFinishedTmp
        where prodParmReportFinishedTmp.ParmId   == prodParmReportFinished.ParmId    &&
              prodParmReportFinishedTmp.ProdId   == prodParmReportFinished.ProdId;

    prodParmReportFinished_ds.executeQuery();

    if (prodParmReportFinishedTmp)
    {
        prodParmReportFinished_ds.positionToRecord(prodParmReportFinishedTmp);
    }

    prodParmUpdate_ds.refresh(); //Update late selection checkbox
    prodParmUpdate.reread();
}

public void handleReportFinishProd(boolean _setValue)
{
    OprNum  lastOperNum;
    boolean allowEdit = false;
    NoYes   value     = NoYes::Yes;

    lastOperNum = ProdRoute::lastOprNum(prodParmReportFinished.ProdId);

    if (!lastOperNum && prodParmReportFinished.ToOprNum)
    {
        operations_ReportFinishProd.allowEdit(false);
        if (_setValue)
        {
            prodParmReportFinished.FromOprNum       = 0;
            prodParmReportFinished.ToOprNum         = 0;
            prodParmReportFinished.ReportFinishProd = NoYes::Yes;
            warning("@SYS89015");
            return;
        }
    }

    if ((prodParmReportFinished.FromOprNum   && !prodParmReportFinished.ToOprNum) ||
       (prodParmReportFinished.ToOprNum     && prodParmReportFinished.ToOprNum == lastOperNum))
    {
        allowEdit = true;
        value     = NoYes::Yes;
    }
    else if (prodParmReportFinished.ToOprNum && prodParmReportFinished.ToOprNum != lastOperNum)
    {
        allowEdit = false;
        value     = NoYes::No;
    }

    operations_ReportFinishProd.allowEdit(allowEdit);

    if (_setValue)
    {
        prodParmReportFinished.ReportFinishProd = value;
    }
}

void init()
{
    ProdTable callerProdTable;

    prodMultiReportFinished = element.args().caller().runbase();
    pmfFrmCtrl = PmfFormCtrl_ProdParmReportFinished::newFromForm(element);
    pmfFrmCtrl.initPre();

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);

    callerProdTable = prodMultiReportFinished.pmfProdTable();

    if (callerProdTable && callerProdTable.ProdType == ProdType::Process)
    {
        prodParmReportFinished_DS.allowCreate(callerProdTable.PmfCoByVarAllow);
        CustomRemoveButton.visible(callerProdTable.PmfCoByVarAllow);
        CustomNewButton.visible(callerProdTable.PmfCoByVarAllow);
    }
    pmfFrmCtrl.setDatasources(prodParmReportFinished, inventDim);
    pmfFrmCtrl.initPost();

    prodParmUpdate_ds.query().dataSourceTable(tableNum(ProdParmUpdate)).addRange(fieldNum(ProdParmUpdate, ParmId)).value(queryValue(prodMultiReportFinished.parmId()));
}

