public boolean pdsCheckBaseValue()
{
    ProdParmReportFinished  prodParmRAF;
    InventTransOrigin       transOrigin;
    InventTrans             inventTrans;
    boolean                 ret = true;
    boolean                 isCWItem;

    if (!#PDSPotencyEnabled)
    {
        return true;
    }

    boolean isProdReportFinishReverseLpLocationFlightEnabled = ProdReportFinishReverseLpLocationFlight::instance().isEnabled();

    while select ItemId, pdsBaseValue, QtyGood, InventDimId
        from prodParmRAF
        where prodParmRAF.ParmId   == prodMultiReportFinished.parmId()
            && (prodParmRAF.QtyGood > 0
                || ProdParmReportFinishedNegativeQuantityFlight::instance().isEnabled()
        )
    {
        if (prodParmRAF.QtyGood < 0)
        {
            InventDim prodParmRAFInventDim = InventDim::find(prodParmRAF.InventDimId);

            if(!prodParmRAFInventDim.LicensePlateId)
            {
                boolean isWhsLocationIsLPControlled;

                if (isProdReportFinishReverseLpLocationFlightEnabled && prodParmRAFInventDim.wmsLocationId)
                {
                    isWhsLocationIsLPControlled = WMSLocation::find(prodParmRAFInventDim.wmsLocationId, prodParmRAFInventDim.InventLocationId).whsLocationIsLPControlled();
                }

                if (!isProdReportFinishReverseLpLocationFlightEnabled || isWhsLocationIsLPControlled)
                {
                    ret = ret && checkFailed(strFmt("@SCM:LicensePlateMustBeSpecified", prodParmRAFInventDim.wMSLocationId, prodParmRAFInventDim.inventLocationId));
                }
            }
            continue;
        }

        if (InventTable::isPotencyItem(prodParmRAF.ItemId)
            && InventTable::find(prodParmRAF.ItemId).pdsPotencyAttribRecording == PDSPotencyAttribRecordingEnum::PurchProdReceipt)
        {
            if (prodParmRAF.pdsBaseValue != '')
            {
                if (!str2NumOk(prodParmRAF.pdsBaseValue))
                {
                    ret = checkFailed(strFmt("@PSC765", prodParmRAF.ItemId)) && ret;
                }

                continue;
            }

            select RecId
                from transOrigin
                where transOrigin.InventTransId         == prodParmReportFinished.InventTransId
                    join sum(Qty), sum(PdsCWQty)
                    from inventTrans
                    where inventTrans.InventTransOrigin == transOrigin.RecId
                        && inventTrans.StatusReceipt    == StatusReceipt::Registered
                        && inventTrans.StatusIssue      == StatusIssue::None;

            isCWItem = PdsGlobal::pdsIsCWItem(prodParmRAF.ItemId);
            if ((isCWItem && inventTrans.PdsCWQty < prodParmRAF.PdsCWBatchGood)
                || (!isCWItem && inventTrans.Qty < prodParmRAF.QtyGood))
            {
                ret = checkFailed(strFmt("@PSC649", prodParmRAF.ItemId)) && ret;
            }
        }
    }

    return ret;
}

public boolean pdsCheckBatchDates()
{
    return InventBatch::existsNullDateShelfLifeBatches(prodParmReportFinished.ProdId);
}

public void pdsEnableField()
