void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParm;

    // since the movement does not have the item for additional co-products,
    // we need to get the inventTable record here and use that
    // to determine the inventory dimension group
    InventTable     inventTable = InventTable::find(prodParmReportFinished.ItemId);

    inventMovement = InventMovement::construct(prodParmReportFinished);

    //initialize the dimension parameters according to the movement
    inventMovement.inventDimGroupSetup().inventDimParmActive(inventDimParm);

    if (!inventTable.isCoByProduct() || !prodParmReportFinished.prodTable().PmfCoByVarAllow)
    {
        inventDimParm.clearProductDimensions();
    }

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init          :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element,inventMovement);
            }

        case InventDimFormDesignUpdate::Active        :
            if (!element.allowDimEdit())
            {
                inventDimParm.clear();
            }
            inventDimFormSetup.formActiveSetup(inventMovement.inventDimGroupSetup(),inventMovement);
            inventDimFormSetup.parmDimParmEnabled(inventDimParm);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange   :
            inventDimFormSetup.formActiveSetup(inventMovement.inventDimGroupSetup(),inventMovement);
            inventDimFormSetup.parmDimParmEnabled(inventDimParm);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }

    this.pdsEnableField();
}

