public display PdsBatchDispositionStatus pdsDispositionStatus(ProdParmReportFinished _repFinished)
{
    PdsDispositionCode                  dispCode;
    PdsBatchDispositionStatus           status = PdsStatus::NotApplicable;

    dispCode = this.pdsDispositionCode(_repFinished);
    if (dispCode)
    {
        status = PdsDispositionMaster::find(dispCode).Status;
    }

    return status;
}

public display PdsBatchDispositionCode pdsDispositionCode(ProdParmReportFinished _repFinished)
{
    InventBatch             inventBatch;
    PdsBatchDispositionCode dispCode;

    if (prodParmReportFinished.RecId == _repFinished.RecId)
    {
        if (inventDim.InventBatchId)
        {
            inventBatch = InventBatch::find(
                                inventDim.InventBatchId,
                                prodParmReportFinished.ItemId);

            if (inventBatch.RecId)
            {
                dispCode = inventBatch.PdsDispositionCode;
            }
        }
    }
    else
    {
        dispCode = _repFinished.pdsDispositionCode();
    }

    return dispCode;
}

