public boolean validate()
{
    PDSBaseValue        value;
    InventTrans         inventTrans;
    InventTransOrigin   inventTransOrigin;
    InventDim           localDim;
    PDSBaseAttributeId  attribId = InventTable::find(prodParmReportFinished.ItemId).pdsBaseAttributeId;

    boolean ret = super();

    if (!ret)
    {
        return ret;
    }

    if (inventDim.InventBatchId)
    {
        value = PdsBatchAttributes::find(
                                    prodParmReportFinished.ItemId,
                                    inventDim.InventBatchId,
                                    attribId).PdsBatchAttribValue;

        if (value && prodParmReportFinished.pdsBaseValue != value)
        {
            ret = checkFailed(strFmt("@PSC171", prodParmReportFinished.pdsBaseValue, inventDim.InventBatchId, value));
        }

        if (ret)
        {
            ret = ret && InventTable::pdsFindBaseAttribute(prodParmReportFinished.ItemId).pdsCheckAttribCriteria(prodParmReportFinished.pdsBaseValue);
        }
    }
    else
    {
        select firstonly RecId
            from inventTransOrigin
            where  inventTransOrigin.InventTransId == prodParmReportFinished.InventTransId
                join InventDimId
                from inventTrans
                where inventTrans.InventTransOrigin == inventTransOrigin.RecId
                    && inventTrans.StatusReceipt    == StatusReceipt::Registered
                    && inventTrans.StatusIssue      == StatusIssue::None
                    join InventBatchId
                        from localDim
                        where localDim.InventDimId  == inventTrans.InventDimId
                            && localDim.InventBatchId;

        if (inventTransOrigin.RecId != 0)
        {
            info(strFmt("@PSC648", prodParmReportFinished.ItemId));
        }
    }

    return ret;
}

