boolean validate()
{
    Common      anyBuffer;
    ProdTable   prodTable;
    boolean     ret = super();

    if (ret)
    {
        prodTable = prodParmReportFinished.prodTable();
        if (! prodTable.status().runReportFinished(anyBuffer,true))
        {
            ret = checkFailed(strFmt("@SYS22052",prodTable.ProdStatus));
        }
    }
    return ret;
}

